import React, { Component } from 'react';
const { AccountClient } = require('../matcha_grpc_web_pb');
const { imageData } = require('../matcha_pb');

class Test extends Component {
	constructor(props) {
		super(props);
		this.state = {
			image: ''
		}
	}

	getImage = () => {
		const client = new AccountClient('http://10.43.1.110:8080');
		const request = new imageData();
		const data = request.getImage();
		client.imageData(request, {}, (err, reply) => {
			if (err) {
				console.log(err.code);
				console.log(err.message);
			} else {
				console.log(reply.getMessage());
				const Example = ({ data }) => <img src={`data:image/jpeg;base64,${data}`} />
			}
		})
	}

	render() {
		this.getImage();
		<Example data={data} />
		return (
			<div>test page</div>
		)
	}
}

export default Test;
